overview:
Backed by class `EventDimensionChange`.

### Fields

*   **dimension** (`string`): The ID of the new dimension the player is entering. Common IDs include 'minecraft:overworld', 'minecraft:the_nether', 'minecraft:the_end'.
*   **from** (`string`): The ID of the dimension the player is leaving.

### Behavior

*   Fires when the player travels between different dimensions
*   Common dimension transitions include Overworld ↔ Nether, Overworld ↔ End
*   Not cancellable

### Signature

```js
JsMacros.on("DimensionChange", JavaWrapper.methodToJavaAsync((event) => {
  // ...
}));
```

### Minimal example

```js
JsMacros.on("DimensionChange", JavaWrapper.methodToJavaAsync((e) => {
  Chat.log(`Dimension changed from ${e.from} to ${e.dimension}`);
});
```
